		<!-- VERTEX SHADER ! ROFL -->
		<script id="water-shader-vs" type="x-shader/x-vertex">
			attribute vec2 vertexPos;
			
			uniform mat4 pvm;
			uniform vec4 waterColor;
			
			varying lowp vec4 vWaterColor;
			
			void main(){
				gl_Position = pvm * vec4(vertexPos, 0.0, 1.0);
				
				vWaterColor = waterColor;
			}
		</script>
		
		<!-- FRAGMENT SHADER ! LMAO -->
		<script id="water-shader-fs" type="x-shader/x-fragment">
			varying lowp vec4 vWaterColor;
			
			void main(){
				gl_FragColor = vWaterColor;
			}
		</script>

			}

		<!-- FRAGMENT SHADER ! LMAO -->

			void main(){

			}

		<!-- VERTEX SHADER ! ROFL -->
		<script id="shader-vs" type="x-shader/x-vertex">
			attribute vec3 vertexPos;
			attribute vec4 vertexColor;
			attribute vec3 vertexNormal;
			
			uniform mat4 normalMatrix;
			uniform mat4 pvm;
			uniform mat4 lightBiasPVM;
			uniform vec3 lightDirection;
			
			uniform vec4 overrideColor;
			
			varying lowp vec4 vColor;
			varying lowp vec4 vOverrideColor;
			varying highp vec3 vLighting;
			varying highp vec3 vAmbientLight;
			varying highp float vCosTheta;
			
			varying highp vec4 vShadowCoord;
			
			void main(){
				gl_Position = pvm * vec4(vertexPos, 1.0);
				vColor = vertexColor;
				vOverrideColor = overrideColor;
				
				// Apply lighting effect

				highp vec3 ambientLight = vec3(0.45, 0.4, 0.45);
				highp vec3 directionalLightColor = vec3(0.45, 0.45, 0.4);
				highp vec3 directionalVector = lightDirection * -1.0;

				highp vec4 transformedNormal = normalMatrix * vec4(vertexNormal, 2.0);
				highp float directional = clamp(dot(transformedNormal.xyz, directionalVector), 0.0, 2.0);
				vLighting = directionalLightColor * directional;
				vAmbientLight = ambientLight;
				vCosTheta = clamp(dot(transformedNormal.xyz, directionalVector), 0.0, 0.5);
				
				vShadowCoord = lightBiasPVM * vec4(vertexPos, 1.0);
			}
		</script>
		
		<!-- FRAGMENT SHADER ! LMAO -->
		<script id="shader-fs" type="x-shader/x-fragment">
			varying lowp vec4 vColor;
			varying lowp vec4 vOverrideColor;
			varying highp vec3 vLighting;
			varying highp vec3 vAmbientLight;
			varying highp float vCosTheta;
			
			varying highp vec4 vShadowCoord;
			
			uniform sampler2D lightDepthTexture;
			
			void main(){
				highp float bias = 0.005 * tan(acos(vCosTheta));
				bias = clamp(bias, 0.0, 1.0);
				
				highp vec2 poissonDisk[8];
				poissonDisk[0] = vec2(-0.02122013, -0.006128885);
				poissonDisk[1] = vec2(0.5648766, 0.5561424);
				poissonDisk[2] = vec2(0.2652976, -0.6267805);
				poissonDisk[3] = vec2(-0.5816646, -0.6707885);
				poissonDisk[4] = vec2(-0.3506662, 0.4821354);
				poissonDisk[5] = vec2(0.8141245, -0.1356266);
				poissonDisk[6] = vec2(-0.8547717, -0.1485736);
				poissonDisk[7] = vec2(0.1537051, 0.6777892);
				
				highp float visibility = 1.0;
				
				for(int i = 0; i < 8; i++){
					if(texture2D(lightDepthTexture, vShadowCoord.xy + poissonDisk[i]/2400.0).x < vShadowCoord.z-bias){
						visibility -= 0.1;
					}
				}
				
				if(vShadowCoord.x > 1.0 || vShadowCoord.x < 0.0 || vShadowCoord.y > 1.0 || vShadowCoord.y < 0.0){
					visibility = 1.0;
				}
				
				gl_FragColor = mix(vec4(vColor.rgb * (vAmbientLight + (vLighting * visibility)), vColor.a), vec4(vOverrideColor.rgb, 1.0), vOverrideColor.a);
			}
		</script>
